Dare To Open The China BoxA vengeance is being plotted around the inauguration of a club, the China Box This is the point of departure of one of the most erotic films of director Antonio Adamo. Laura Angel heads the cast, playing the part of a judge who leads a double life: judge by day and prostitute by night. Along with her, 11 sculptural girls will leave you breathless in this frenetic film packed with anal and oral sex, as well as double penetrations, in the best Private tradition.

